import React, { useState } from 'react';
import { MenuItems } from './MenuItems';
import './Navbar.css';
// import LocationDropdown from './LocationDropdown';
import Searchbar from './Searchbar';
import { Signinbutton } from './Signinbutton';

const Navbar = () => {
    // const state={clicked: false}
    const [state, setState] = useState(false);

    const handleClick = () => {
        setState(current => !current);
        console.log('clicked');
    }

    return (
        <>
            {/* <nav className="navbarItems">
                <h1 className="navbar-logo">SellYourCar<i className="fa fa-car"></i></h1>
                <div className="menu-icon" onClick={handleClick}>
                    <i className={state ? 'fas fa-times' : 'fas fa-bars'}></i>

                </div>
                <ul className={state ? 'nav-menu active ' : 'nav-menu '} >
                    
                    <li >
                        <Searchbar />
                    </li>

                </ul>
                <ul className={state ? 'nav-menu active ' : 'nav-menu '}>
                    {MenuItems.map((item, index) => {
                        return (
                            <li key={index} >
                                <a className={item.cName} href={item.url} >
                                    {item.title}
                                </a>
                            </li>


                        )
                    })}
                </ul>
                <Signinbutton>SignIn</Signinbutton>
            </nav> */}


            <input type="checkbox" />
            <nav>
                <div className="icon"><b style={{color: 'red'}}>S</b>ell<b style={{color: 'red'}}>C</b>ar</div>
                <div className="search_box">
                    <input type="search" placeholder="Search Car" />
                    <span className="fa fa-search"></span>
                </div>
                <ol>
                    <li><a href="#">Login1</a></li>
                    <li><a href="#">Login2</a></li>
                    <li><a href="#">Login3</a></li>
                    <li><a href="#">Login4</a></li>
                    <li><a href="#">Login5</a></li>
                </ol>
                <label for="" className="bar">
                    <span className="fa fa-bars" id="bars"></span>
                    <span className="fa fa-times" id="times"></span>
                </label>
            </nav>
        </>
    )
}

export default Navbar;
